<!DOCTYPE html>
<html>
<head>
    <title>ConfigBot</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <meta name="robots" content="noindex, nofollow">
    <meta name="description" content="Home">
    <meta name="keywords" content="Console, Bot, Discord, Bot Console, Websocket, Socket.io, Client, Server, MiraiBot">
    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            transition: background-color 0.3s ease, color 0.3s ease;
            background-size: cover;
            background-repeat: no-repeat;
            background-position: center;
            color: white; 
            font-family: Arial, sans-serif;
        }

        h1 {
            margin-bottom: 20px;
        }

        form {
            display: flex;
            flex-direction: column;
            align-items: center; 
            justify-content: center;
            padding: 20px;
            background-color: rgba(0, 0, 0, 0.5); 
            border-radius: 10px; 
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1); 
        }

        label {
            margin-bottom: 5px; 
            font-weight: bold; 
        }

        input {
            margin-bottom: 10px;
            padding: 5px;
            width: 100%;
            box-sizing: border-box; 
            border-radius: 5px; 
            border: 1px solid #ccc; 
        }

        button {
            margin-top: 20px;
            padding: 10px 20px;
            background-color: #007bff;
            color: white;
            border: none;
            cursor: pointer;
            border-radius: 5px; 
            transition: background-color 0.3s ease; 
        }

        button:hover {
            background-color: #0056b3;
        }

    </style>
</head>
<body>
    <h1>Configuration Form</h1>
    <form id="configForm">

        <input type="text" id="FCAOption.autoMarkDelivery" name="FCAOption.autoMarkDelivery" required>

        <input type="text" id="FCAOption.autoMarkRead" name="FCAOption.autoMarkRead" required>

        <label for="FCAOption.logLevel">Log Level:</label>
        <input type="text" id="FCAOption.logLevel" name="FCAOption.logLevel" required>

        <label for="FCAOption.selfListen">Self Listen:</label>
        <input type="text" id="FCAOption.selfListen" name="FCAOption.selfListen" required>

        <label for="FCAOption.online">Online:</label>
        <input type="text" id="FCAOption.online" name="FCAOption.online" required>

        <label for="FCAOption.userAgent">User Agent:</label>
        <input type="text" id="FCAOption.userAgent" name="FCAOption.userAgent" required>

                <label for="FCAOption.forceLogin">Force Login:</label>
        <input type="text" id="FCAOption.forceLogin" name="FCAOption.forceLogin" required>


        <button type="submit">Save</button>
    </form>
